
import os

import io
import base64
from PIL import Image

image_data = ""

folder_path = "static/crm/img/posts"
file_name = 'img_123.png'
full_path = os.path.join(folder_path, file_name)
img = Image.open(io.BytesIO(base64.decodebytes(bytes(image_data, "utf-8"))))
img.save(full_path)
image_path = full_path[len("static/"):] 
print("Image is saved---",full_path)
print("Image is saved---",image_path)